ssenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://sun.boikot.com.ua/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2023-11-11 15:27:13','2023-11-11 15:27:13','',2,'https://sun.boikot.com.ua/?p=27',0,'revision','',0),(28,1,'2023-11-11 15:27:31','2023-11-11 15:27:31','','Home','','publish','closed','closed','','home','','','2023-11-13 07:21:36','2023-11-13 07:21:36','',0,'https://sun.boikot.com.ua/?page_id=28',0,'page','',0),(29,1,'2023-11-11 15:27:31','2023-11-11 15:27:31','','Home','','inherit','closed','closed','','28-revision-v1','','','2023-11-11 15:27:31','2023-11-11 15:27:31','',28,'https://sun.boikot.com.ua/?p=29',0,'revision','',0),(30,1,'2023-11-22 18:17:29','2023-11-11 15:47:05',' ','','','publish','closed','closed','','30','','','2023-11-22 18:17:29','2023-11-22 18:17:29','',0,'https://sun.boikot.com.ua/?p=30',1,'nav_menu_item','',0),(31,1,'2023-11-22 18:17:29','2023-11-11 15:47:05','','DEMO LAYOUTS','','publish','closed','closed','','demo-layouts','','','2023-11-22 18:17:29','2023-11-22 18:17:29','',0,'https://sun.boikot.com.ua/?p=31',2,'nav_menu_item','',0),(32,1,'2023-11-22 18:17:29','2023-11-11 15:47:05','','Pre-built pages','','publish','closed','closed','','pre-built-pages','','','2023-11-22 18:17:29','2023-11-22 18:17:29','',0,'https://sun.boikot.com.ua/?p=32',13,'nav_menu_item','',0),(33,1,'2023-11-22 18:17:29','2023-11-11 15:47:05','','Portfolio','','publish','closed','closed','','portfolio','','','2023-11-22 18:17:29','2023-11-22 18:17:29','',0,'https://sun.boikot.com.ua/?p=33',17,'nav_menu_item','',0),(34,1,'2023-11-22 18:17:29','2023-11-11 15:47:05','','Contact Us #3','','publish','closed','closed','','contact-us-1','','','2023-11-22 18:17:29','2023-11-22 18:17:29','',0,'https://sun.boikot.com.ua/?p=34',16,'nav_menu_item','',0),(37,1,'2023-11-11 17:12:21','2023-11-11 17:12:21','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2023-11-11 17:12:21','2023-11-11 17:12:21','',0,'https://sun.boikot.com.ua/wp-content/uploads/2023/11/woocommerce-placeholder.png',0,'attachment','image/png',0),(38,1,'2023-11-11 17:12:22','2023-11-11 17:12:22','','Shop','','publish','closed','closed','','shop','','','2023-11-11 17:12:22','2023-11-11 17:12:22','',0,'https://sun.boikot.com.ua/shop/',0,'page','',0),(39,1,'2023-11-11 17:12:22','2023-11-11 17:12:22','<!-- wp:shortcode -->[woocommerce_cart]<!-- /wp:shortcode -->','Cart','','publish','closed','closed','','cart','','','2023-11-11 17:12:22','2023-11-11 17:12:22','',0,'https://sun.boikot.com.ua/cart/',0,'page','',0),(40,1,'2023-11-11 17:12:22','2023-11-11 17:12:22','<!-- wp:shortcode -->[woocommerce_checkout]<!-- /wp:shortcode -->','Checkout','','publish','closed','closed','','checkout','','','2023-11-11 17:12:22','2023-11-11 17:12:22','',0,'https://sun.boikot.com.ua/checkout/',0,'page','',0),(41,1,'2023-11-11 17:12:22','2023-11-11 17:12:22','<!-- wp:shortcode -->[woocommerce_my_account]<!-- /wp:shortcode -->','My account','','publish','closed','closed','','my-account','','','2023-11-11 17:12:22','2023-11-11 17:12:22','',0,'https://sun.boikot.com.ua/my-account/',0,'page','',0),(42,1,'2023-11-11 17:12:22','0000-00-00 00:00:00','<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h3>Overview</h3>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we can’t offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Gift cards</li>\n<li>Downloadable software products</li>\n<li>Some health and personal care items</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Book with obvious signs of use</li>\n<li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li>\n<li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li>\n<li>Any item that is returned more than 30 days after delivery</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<h2>Refunds</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Late or missing refunds</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you haven’t received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you’ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Sale items</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Exchanges</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Gifts</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, you’ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasn’t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Shipping returns</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We don’t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Need help?</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->','Refund and Returns Policy','','draft','closed','closed','','refund_returns','','','2023-11-11 17:12:22','0000-00-00 00:00:00','',0,'https://sun.boikot.com.ua/?page_id=42',0,'page','',0),(44,1,'2023-11-11 17:22:23','2023-11-11 17:22:23','Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.','V-Neck T-Shirt','This is a variable product.','publish','open','closed','','v-neck-t-shirt','','','2023-11-11 17:22:58','2023-11-11 17:22:58','',0,'https://sun.boikot.com.ua/?post_type=p